import React from "react";

const Navbar = () => {
  return (
    <nav class="navbar bg-body-tertiary">
      <div className="container-fluid">
        <span className="navbar-brand mb-0 h1">Navbar</span>
      </div>
    </nav>
  );
};

export default Navbar;
